4. Insurance Requirements (Annex 3 “Insurance”)

Current: Agency must carry workmen’s comp and third-party liability; Sun & Sand version also requires media liability (5× contract value) and cyber insurance.


Proposed amended Annex 3:



“The Agency shall maintain, at its own expense, the following insurance, naming the Client and its Affiliates as additional insureds and waiving subrogation rights:
• Workers’ compensation as required by law;
• Commercial general liability of at least USD 1,000,000 per occurrence;
• Media liability insurance of at least five (5) times the annual retainer value;
• Cyber liability insurance with limits of not less than USD 1,000,000;
• Professional indemnity (E&O) insurance with limits equal to the annual retainer value.”

This combination ensures full coverage of all potential risks.

